import React, { useState, useEffect } from 'react';
import Sidebar from '../components/Sidebar';
import axios from 'axios';
import { Modal, Box, Typography } from '@mui/material';

const CompletedTasks = () => {
  const [completedTasks, setCompletedTasks] = useState([]);
  const [selectedPatient, setSelectedPatient] = useState(null);

  useEffect(() => {
    fetchCompletedTasks();
  }, []);

  const fetchCompletedTasks = async () => {
    try {
      const response = await axios.get('http://localhost:5000/completed-tasks');
      setCompletedTasks(response.data);
    } catch (error) {
      console.error('Error fetching completed tasks:', error);
    }
  };

  const handleRowClick = async (patientId) => {
    try {
      const response = await axios.get('http://localhost:5000/patients');
      const patient = response.data.find((p) => p['Patient ID'] === patientId);
      setSelectedPatient(patient);
    } catch (error) {
      console.error('Error fetching patient details:', error);
    }
  };

  const handleCloseModal = () => {
    setSelectedPatient(null);
  };

  return (
    <div style={{ display: 'flex' }}>
      <Sidebar />
      <main
        style={{
          flexGrow: 1,
          padding: '20px',
          marginTop: 64,
          boxSizing: 'border-box',
        }}
      >
        <h1>Completed Tasks</h1>
        <table style={{ width: '100%', borderCollapse: 'collapse' }}>
          <thead>
            <tr>
              <th style={{ border: '1px solid #ddd', padding: '8px' }}>Patient ID</th>
              <th style={{ border: '1px solid #ddd', padding: '8px' }}>Task Type</th>
              <th style={{ border: '1px solid #ddd', padding: '8px' }}>Urgency Level</th>
              <th style={{ border: '1px solid #ddd', padding: '8px' }}>Completion Time</th>
              <th style={{ border: '1px solid #ddd', padding: '8px' }}>Cost</th>
            </tr>
          </thead>
          <tbody>
            {completedTasks.map((task, index) => (
              <tr
                key={index}
                onClick={() => handleRowClick(task.id)}
                style={{ cursor: 'pointer' }}
              >
                <td style={{ border: '1px solid #ddd', padding: '8px' }}>{task.id}</td>
                <td style={{ border: '1px solid #ddd', padding: '8px' }}>{task.type}</td>
                <td style={{ border: '1px solid #ddd', padding: '8px' }}>{task.urgency}</td>
                <td style={{ border: '1px solid #ddd', padding: '8px' }}>{task.completionTime} minutes</td>
                <td style={{ border: '1px solid #ddd', padding: '8px' }}>${task.cost}</td>
              </tr>
            ))}
          </tbody>
        </table>

        {/* Patient Details Modal */}
        <Modal
          open={!!selectedPatient}
          onClose={handleCloseModal}
          aria-labelledby="patient-details-title"
          aria-describedby="patient-details-description"
        >
          <Box
            sx={{
              position: 'absolute',
              top: '50%',
              left: '50%',
              transform: 'translate(-50%, -50%)',
              width: 400,
              bgcolor: 'background.paper',
              borderRadius: '8px',
              boxShadow: 24,
              p: 4,
            }}
          >
            {selectedPatient ? (
              <>
                <Typography id="patient-details-title" variant="h6" component="h2" gutterBottom>
                  Patient Details
                </Typography>
                <Box
                  sx={{
                    maxHeight: 300, // Limit height for scrollable content
                    overflowY: 'auto', // Add vertical scrolling
                    marginTop: 2,
                    paddingRight: 1,
                  }}
                >
                  {Object.entries(selectedPatient).map(([key, value]) => (
                    <Typography key={key} sx={{ marginBottom: 1 }}>
                      <strong>{key}:</strong> {value}
                    </Typography>
                  ))}
                </Box>
                <Button
                  onClick={handleCloseModal}
                  variant="contained"
                  color="primary"
                  sx={{ mt: 3, display: 'block', ml: 'auto', mr: 'auto' }}
                >
                  Close
                </Button>
              </>
            ) : (
              <Typography>Loading...</Typography>
            )}
          </Box>
        </Modal>
      </main>
    </div>
  );
};

export default CompletedTasks;
